-- creeate the table
CREATE TABLE nyc_pois (
    id character varying NOT NULL,
    geom geometry(Point,3857) NOT NULL,
    amenity text NOT NULL,
    cuisine text NOT NULL,
    pname text NOT NULL
);


-- insert the values

-- create the spatial index
CREATE INDEX nyc_pois_geom_idx
ON nyc_pois USING gist (geom);

